import{_ as e,c as i,o as c,a as l}from"./app.b8337294.js";const _=JSON.parse('{"title":"Git \uC5D0 \uB300\uD558\uC5EC","description":"","frontmatter":{},"headers":[{"level":2,"title":"LearnGitBrancing","slug":"learngitbrancing","link":"#learngitbrancing","children":[]}],"relativePath":"moo/about-git.md"}'),o={name:"moo/about-git.md"},t=l('<h1 id="git-\uC5D0-\uB300\uD558\uC5EC" tabindex="-1">Git \uC5D0 \uB300\uD558\uC5EC <a class="header-anchor" href="#git-\uC5D0-\uB300\uD558\uC5EC" aria-hidden="true">#</a></h1><h2 id="learngitbrancing" tabindex="-1"><a href="https://learngitbranching.js.org/" target="_blank" rel="noreferrer">LearnGitBrancing</a> <a class="header-anchor" href="#learngitbrancing" aria-hidden="true">#</a></h2><details class="details custom-block"><summary>Details</summary><ul><li>concepts <ul><li><code>git</code> \uC740 <code>snapshot</code><ul><li>commit \uC804\uD658\uC774 \uBE60\uB984</li><li><code>delta</code> \uB77C\uB294 \uBCC0\uACBD\uC0AC\uD56D\uB9CC \uC801\uC6A9\uB418\uACE0, ref \uB97C \uC5EC\uAE30\uB85C \uD568.</li></ul></li><li><code>branch</code> \uB294 \uB9CE\uC774 \uB9CC\uB4E4\uC5B4\uB3C4 \uBA54\uBAA8\uB9AC\uC5D0 \uBD80\uB2F4\uC774 \uC548\uB428.</li></ul></li><li><code>git commit -m [message_title]</code><ul><li><code>git commit --amend</code>: \uD604\uC7AC\uCEE4\uBC0B \uC57D\uAC04 \uC218\uC815\uD558\uAE30</li></ul></li><li><code>git checkout [commit-id]</code>: Head\uB97C \uBD84\uB9AC, \uC55E\uC758 4\uAC1C\uB9CC \uC785\uB825\uD574\uB3C4 \uB428. <ul><li><code>git checkout origin/main</code>: detached head \uC0C1\uD0DC</li></ul></li><li><code>git merge bugFix</code> (current branch: main)</li><li><code>git rebase main</code> (current branch: bugFix) <ul><li><code>git rebase --onto [main] [common_parent_branch] [bugFix]</code></li><li><code>git rebase -i [\uCEE4\uBC0B\uB4E4\uC774 \uBD99\uC744 \uACF3]</code>: \uC2E4\uC81C\uB85C\uB294 vi editor...</li></ul></li><li>refspec <ul><li><code>^</code>: \uC774\uC804</li><li><code>~[num]</code>: num \uBC88\uC9F8 \uC804</li><li>colon refspec: <code>&lt;source&gt;:&lt;destination&gt;</code></li></ul></li><li><code>git reset [\uB418\uB3CC\uC544\uAC08 \uCEE4\uBC0B]</code>: \uB418\uB3CC\uB9AC\uAE30</li><li><code>git revert [\uBCC0\uACBD\uC0AC\uD56D\uC744 \uCDE8\uC18C\uD560 \uCEE4\uBC0B]</code>: \uD574\uB2F9 \uBCC0\uACBD\uC0AC\uD56D\uC744 \uCDE8\uC18C\uD55C \uCEE4\uBC0B\uC744 \uC791\uC131\uD558\uAE30</li><li><code>git cherry-pick [commit1] [commit2] [commit3]</code></li><li><code>git tag [tag_name] [commit_id]</code>: \uC601\uAD6C\uC801 \uB9C8\uC77C\uC2A4\uD1A4, <code>commit_id</code> \uC9C0\uC815 \uC548\uB418\uBA74 <code>HEAD</code>\uC5D0.</li><li><code>git describe ~</code>: \uD2B9\uC815 \uD0DC\uADF8\uB85C \uBD80\uD130 \uC5BC\uB9C8\uB098 \uB5A8\uC5B4\uC838\uC788\uB294\uC9C0</li><li><code>git clone</code>: \uC6D0\uACA9\uC5D0\uC11C \uAC00\uC838\uC624\uAE30</li><li><code>git fetch</code>: \uB2E4\uC6B4\uB85C\uB4DC\uB9CC <ul><li><code>git fetch origin foo</code>: <code>foo</code> \uB294 <code>place</code></li><li><code>git fetch</code> \uC758 colon refspec <ul><li>\uCCB4\uD06C\uC544\uC6C3 \uC548\uB41C\uBE0C\uB79C\uCE58\uB9CC</li><li><code>git push</code> \uB791 \uC21C\uC11C\uAC00 \uBC18\uB300 (\uC5ED\uD560\uC740 \uAC19\uC9C0\uB9CC source \uAC00 \uC6D0\uACA9\uC758 \uC694\uC18C\uC774\uBBC0\uB85C)</li></ul></li></ul></li><li><code>git push</code>: \uC5C5\uB85C\uB4DC <ul><li><code>git push origin [local_branch]</code></li><li><code>git push origin [source]:[desti]</code></li></ul></li><li><code>git pull</code><ul><li><code>git fetch</code> + <code>git merge origin/main</code> = <code>git pull</code></li><li><code>git pull --rebase</code>: \uBA38\uC9C0\uAC00 \uC544\uB2CC \uB9AC\uBCA0\uC774\uC2A4\uB85C \uD55C\uAC70 <ul><li>\uADF8\uB7F0\uB370 \uC815\uCC45\uC774 \uBC14\uB00C\uC5B4\uC11C, \uD788\uC2A4\uD1A0\uB9AC\uAC00 \uB2E4\uB97C \uACBD\uC6B0\uC5D0\uB294 <code>git pull --merge</code> \uB3C4 \uBA85\uC2DC\uD574\uC918\uC57C\uD568.</li></ul></li><li><code>git pull</code> colon refspec \uC774\uB098 place \uB3C4 \uC778\uC790 \uB3D9\uC77C\uD568.</li></ul></li><li>\uC6D0\uACA9\uBE0C\uB79C\uC9C0 tracking <ul><li><code>git chechkout -b customlocalbranchname origin/b1</code></li><li><code>git branch -u origin/b1 [local_branch]</code>: local branch \uAC00 \uC9C0\uC815\uB418\uC9C0 \uC54A\uC73C\uBA74 \uD604\uC7AC \uBE0C\uB79C\uCE58\uC5D0.</li></ul></li><li>source \uC5C6\uC74C <ul><li><code>git push :[desti]</code></li><li><code>git fetch :[desti]</code>: \uC0C8 \uBE0C\uB79C\uCE58 \uC0DD\uC131</li></ul></li></ul></details>',3),d=[t];function a(r,n,g,u,s,m){return c(),i("div",null,d)}const b=e(o,[["render",a]]);export{_ as __pageData,b as default};
